import React, { Component } from "react";

class asd extends Component {
  state = {
    Posts: [],
    placeholder: "asd",
    loaded: false
  };

  componentDidMount() {
    fetch("http://127.0.0.1:8000/posts/")
      .then(Response => {
        if (Response.status > 400) {
          return this.setState(() => {
            return { placeholder: "Something went wrong!" };
          });
        }
        return Response.json();
      })
      .then(Posts => {
        this.setState(() => {
          return {
            Posts,
            loaded: true
          };
        });
      });
  }

  render() {
    return <h1>hello</h1>;
  }
}

export default asd;
